  display: flex;
  align-items: center;
  gap: 2.75rem;
  border-bottom: 0.5px solid var(--grey-1);
  justify-content: space-between;

  h1 {
    margin-left: 10%;
    color: var(--grey-0);
    font: var(--heading-1-700);
  }
  button {
    margin-right: 10%;
  }
  @media (max-width: 700px) {
    
  }
`;

export const ButtonNav = styled.span`
  font-family: var(--body-1-600);
  color: var(--grey-2);
  cursor: pointer;
  :hover {
    color: var(--brand-1);
  }
  @media (max-width: 700px) {
  }
`;
export const SideBar = styled.div`
  width: 2px;
  height: 70px;
  background-color: var(--grey-6);

  ul {
    background-color: red;
  }
`;
export const ButtonRegisterNav = styled.button`
  background-color: var(--grey-10);
  border: solid 2px var(--grey-6);
  width: 77px;
  height: 40px;
  border-radius: 6px;
  cursor: pointer;
`;
